import React from "react";

function Profile(props) {
  const handleLogOut = () => {
    props.setLoggedIn(false);
  };
  return (
    <div>
      <h1>Profile page</h1>
      <label>First Name - {props.user.firstname}</label>
      <label>Last Name - {props.user.lastname}</label>
      <button type="submit" onClick={handleLogOut}>
        Log out
      </button>
    </div>
  );
}

export default Profile;
